<style>
    :root {

        color: var(--brand-experiment);
        text-decoration: none;
    }

        text-decoration: underline;
    }

        border-left: 4px solid var(--brand-experiment);

        margin-top: 8px;
        border-radius: 4px;
        display: flex;
        flex-direction: column;
    }

    .embed-title {
        font-weight: 600;
        color: var(--text-normal);
        margin-bottom: 8px;
    }

    .embed-description {
        color: var(--text-normal);
        font-size: 14px;
    }

    .embed-field {
        margin-top: 8px;
    }

    .embed-field-name {
        font-weight: 600;
        color: var(--text-normal);
        font-size: 14px;
    }

    .embed-field-value {
        color: var(--text-normal);
        font-size: 14px;
    }

    .embed-footer {
        font-size: 12px;
        color: var(--text-muted);
        margin-top: 8px;
    }

    .system-message {
        color: var(--text-muted);
        font-size: 14px;
        text-align: center;
        margin: 16px 0;
    }

    pre {
        background: var(--background-tertiary);
        border-radius: 4px;
        padding: 12px;
        font-family: 'Consolas', 'Courier New', Courier, monospace;
        font-size: 14px;
        margin: 8px 0;
        overflow-x: auto;
    }

    .message-group {
        margin-bottom: 16px;
    }

    .message-group:last-child {
        margin-bottom: 0;
